import{_ as a,c as e,o as t,a4 as r}from"./chunks/framework.Dp2ecPID.js";const k=JSON.parse('{"title":"Typora基础教程","description":"","frontmatter":{},"headers":[],"relativePath":"Help/Typora基础教程.md","filePath":"Help/Typora基础教程.md"}'),l={name:"Help/Typora基础教程.md"},i=r('<h1 id="typora基础教程" tabindex="-1">Typora基础教程 <a class="header-anchor" href="#typora基础教程" aria-label="Permalink to &quot;Typora基础教程&quot;">​</a></h1><hr><p>Typora 实时预览</p><p>基于Markdown编辑器</p><p>Markdown 轻量级标记语言 支持Latex语法，代码高亮 自动排版</p><h2 id="右键" tabindex="-1">右键 <a class="header-anchor" href="#右键" aria-label="Permalink to &quot;右键&quot;">​</a></h2><p>设置文本样式，光标停留在该行即可，或三击左键选中行后设置</p><p>推荐一开始用这个，记不住快捷键也可以右键查看</p><h2 id="标题" tabindex="-1">标题 <a class="header-anchor" href="#标题" aria-label="Permalink to &quot;标题&quot;">​</a></h2><p>使用n个#加上一个空格之后编辑</p><p>也可以使用<code>Ctrl 1/2/3/4</code>后编辑</p><h2 id="加粗" tabindex="-1">加粗 <a class="header-anchor" href="#加粗" aria-label="Permalink to &quot;加粗&quot;">​</a></h2><p><code>Ctrl B </code><strong>然后在里面写字，也可以选中后快捷键</strong></p><h2 id="斜体" tabindex="-1">斜体 <a class="header-anchor" href="#斜体" aria-label="Permalink to &quot;斜体&quot;">​</a></h2><p><code>Ctrl I</code> <em>然后在里面写字，也可以选中后快捷键</em></p><h2 id="下划线" tabindex="-1">下划线 <a class="header-anchor" href="#下划线" aria-label="Permalink to &quot;下划线&quot;">​</a></h2><p><code>Ctrl U</code> <u>然后在里面打字，也可以选中后快捷键</u></p><h2 id="删除线" tabindex="-1">删除线 <a class="header-anchor" href="#删除线" aria-label="Permalink to &quot;删除线&quot;">​</a></h2><p>前后各两个波浪号<code>~</code></p><p><s>这是被删除的部分</s></p><h2 id="无序列表" tabindex="-1">无序列表 <a class="header-anchor" href="#无序列表" aria-label="Permalink to &quot;无序列表&quot;">​</a></h2><p>输入英文<strong>横线</strong>/星号/加号<code>- * +</code>加上一个空格之后输入，变成原点，输入内容之后回车会自动添加一个列表，若不需要继续添加，可以再输入一个回车</p><ul><li>左边是无序列表的标志，这后面一个回车和两个回车效果不同</li></ul><h2 id="有序列表" tabindex="-1">有序列表 <a class="header-anchor" href="#有序列表" aria-label="Permalink to &quot;有序列表&quot;">​</a></h2><p>输入数字加英文句号加空格</p><ol><li>无序</li><li>有序</li></ol><h2 id="任务列表" tabindex="-1">任务列表 <a class="header-anchor" href="#任务列表" aria-label="Permalink to &quot;任务列表&quot;">​</a></h2><p>先生成无序列表的圆点，接着输入<code>[ ] </code>：方括号里面一个空格，后面还有一个空格</p><ul><li>[ ] 任务1</li><li>[ ] 任务2</li></ul><h2 id="表情" tabindex="-1">表情 <a class="header-anchor" href="#表情" aria-label="Permalink to &quot;表情&quot;">​</a></h2><p>英文冒号加字母后选择，<a href="https://www.cnblogs.com/wangjs-jacky/p/12011208.html" target="_blank" rel="noreferrer">参考</a></p><p>✨ 🍚🌦️💦✅</p><h2 id="代码块" tabindex="-1">代码块 <a class="header-anchor" href="#代码块" aria-label="Permalink to &quot;代码块&quot;">​</a></h2><p>两个飘号``，在中间编辑</p><p><code>this is daimakuai</code></p><h2 id="表格" tabindex="-1">表格 <a class="header-anchor" href="#表格" aria-label="Permalink to &quot;表格&quot;">​</a></h2><p>使用<code>Ctrl T</code>之后填写行列数，点击表格后左上角和右上角也有相应功能</p><table><thead><tr><th style="text-align:center;"></th><th style="text-align:center;"></th><th style="text-align:center;"></th><th style="text-align:center;"></th></tr></thead><tbody><tr><td style="text-align:center;">1</td><td style="text-align:center;">3</td><td style="text-align:center;"></td><td style="text-align:center;">4</td></tr><tr><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">2</td><td style="text-align:center;"></td></tr></tbody></table><h2 id="高亮" tabindex="-1">高亮 <a class="header-anchor" href="#高亮" aria-label="Permalink to &quot;高亮&quot;">​</a></h2><p>左右各两个等号，需要开启Markdown扩展语法</p><p>==highlight==</p><h2 id="分割线" tabindex="-1">分割线 <a class="header-anchor" href="#分割线" aria-label="Permalink to &quot;分割线&quot;">​</a></h2><p><code>---</code>输入三个横线回车即可</p><hr><h2 id="代码" tabindex="-1">代码 <a class="header-anchor" href="#代码" aria-label="Permalink to &quot;代码&quot;">​</a></h2><ul><li>方法1：输入英文的三个飘号```之后回车，在右下角输入语言</li><li>方法2：输入英文的三个飘号```之后不急着回车，可以输入代码语言，如java，之后左下角就不用选了</li><li>显示行号设置：点击左上角文件-&gt;偏好设置<code>ctrl ,</code>-&gt;Markdown-&gt;右侧的代码块中勾选显示行号</li></ul><div class="language-c++ vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">c++</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">cout </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&lt;&lt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;hello&quot;</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;&lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> endl;</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">dfsaf</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">    dfaf</span></span></code></pre></div><h2 id="公式" tabindex="-1">公式 <a class="header-anchor" href="#公式" aria-label="Permalink to &quot;公式&quot;">​</a></h2><ol><li>内嵌公式$e^2$</li><li>英文模式下输入两个$$后回车，在上下两行间进行编辑</li></ol><p>$$ f(x) = x^2 $$</p><p>$$ F = ma $$</p><h2 id="超链接" tabindex="-1">超链接 <a class="header-anchor" href="#超链接" aria-label="Permalink to &quot;超链接&quot;">​</a></h2><p><code>Ctrl K</code>，或者英文的方括号加上圆括号</p><h2 id="引用" tabindex="-1">引用 <a class="header-anchor" href="#引用" aria-label="Permalink to &quot;引用&quot;">​</a></h2><p>大于号加空格或者<code>Ctrl Shift Q</code></p><h2 id="本地或者图片链接" tabindex="-1">本地或者图片链接 <a class="header-anchor" href="#本地或者图片链接" aria-label="Permalink to &quot;本地或者图片链接&quot;">​</a></h2><p><code>Ctrl Shift I</code> 圆括号中输入链接</p><p><img src="https://t7.baidu.com/it/u=4080826490,615918710&amp;fm=193&amp;f=GIF" alt=""></p><hr><h5 id="参考资料" tabindex="-1">参考资料 <a class="header-anchor" href="#参考资料" aria-label="Permalink to &quot;参考资料&quot;">​</a></h5><p><a href="https://www.bilibili.com/video/BV1yW411s7og/?spm_id_from=333.337.search-card.all.click&amp;vd_source=b9f16feb6ff7836e90c4ba95657422ea" target="_blank" rel="noreferrer">Typora 编辑器 —— 书写即为美学</a></p><h5 id="typora下载" tabindex="-1">Typora下载 <a class="header-anchor" href="#typora下载" aria-label="Permalink to &quot;Typora下载&quot;">​</a></h5><p><a href="https://shishu.lanzouf.com/iAXEl07ljsgh" target="_blank" rel="noreferrer">Typora 1.3.6 密码:coa9</a></p><h5 id="latex相关" tabindex="-1">LaTeX相关 <a class="header-anchor" href="#latex相关" aria-label="Permalink to &quot;LaTeX相关&quot;">​</a></h5><p><a href="https://www.latexlive.com/home" target="_blank" rel="noreferrer">LaTex公式编辑器</a></p><p><a href="https://blog.csdn.net/NSJim/article/details/109045914?ops_request_misc=%257B%2522request%255Fid%2522%253A%2522166917098416800180634812%2522%252C%2522scm%2522%253A%252220140713.130102334..%2522%257D&amp;request_id=166917098416800180634812&amp;biz_id=0&amp;spm=1018.2226.3001.4187" target="_blank" rel="noreferrer">LaTex数学公式整理</a></p><p><a href="https://www.cnblogs.com/1024th/p/15269659.html" target="_blank" rel="noreferrer">LaTex公式手册（按年级分类）</a></p>',67),o=[i];function h(s,n,d,p,c,u){return t(),e("div",null,o)}const m=a(l,[["render",h]]);export{k as __pageData,m as default};
